import React from 'react';
import './App.css';
import Navbar from './components/misc/Navbar';
import Search from './components/src/Search';
import { Switch, Route } from 'react-router-dom';
import Home from './components/src/Home';
import Register from './components/misc/Register'
import Login from './components/misc/Login'
import Profile from './components/misc/Profile'
import UpProduct from './components/misc/UpProduct'



function App() {
  return (
    <div className="App">
      <Navbar />
       <Search />

      <Switch>

          <Route exact path="/">
            <Home />
          </Route>

          <Route exact path="/register">
            <Register /> 
          </Route>

          <Route exact path="/login">
            <Login /> 
          </Route>

          <Route exact path="/profile">
            <Profile /> 
          </Route>

          <Route exact path="/product/new">
            <UpProduct />
          </Route>

      </Switch>
    </div>
  );
}

export default App;
